import { ConfigProvider, Layout, Space } from 'antd';
import React from 'react';

const { Header, Footer, Content } = Layout;

const App = () => (
  <ConfigProvider
    theme={{
      token: {
        colorPrimary: '#1DA57A',
        // margin: 0,
        // padding: 0,
      },
    }}
  >
    <Space
    direction="vertical"
    style={{
      width: '100%',
    }}
    size={[0, 48]}
  >
    <Layout>
      <Header>Header</Header>
      <Content>Content</Content>
      <Footer>Footer</Footer>
    </Layout>
  </Space>
  </ConfigProvider>
);

export default App;
